(1, 'Yamaha ydp145 arius nero satinato', 899.00, 'pianoforte digitale 88 tasti pesati nero\n\nil suono elegante e la facilità espressiva di suonare rimangono fedeli alle basi di un vero pianoforte. si suona quasi da solo, rilasciando il suono e la musica che hai dentro. inizia la giornata con la musica e un grande sorriso sul viso: i pianoforti arius ti fanno venire voglia di suonare sempre di più. l\'ydp-145 dotato di un suono di piano campionato dal pianoforte a coda da concerto cfx, modello di punta yamaha, un rinomato pianoforte che offre alti scintillanti e bassi potenti e risonanti combinati in un suono superbamente espressivo.', 0, 'Yamaha', 140, 38, 1000, , 1);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(2, 'Yamaha clp825 black', 1409.00, 'la grand expression modeling e i pedali grandtouch offrono capacit espressive che si\navvicinano a quelle di un pianoforte a coda grazie anche alle voci di due dei migliori pianoforti a\ncoda al mondo: yamaha cfx e bsendorfer imperial. include una gamma completa delle\nfunzionalit di pianoforte digitale, compreso l\'audio bluetooth.', 0, 'Yamaha', 145, 42, 98, , 1);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
