INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(4, 'Roland lx-5 ch charcoal black', 2329.00, 'l\'lx-5 un pianoforte verticale accessibile che fornisce una solida base per lo sviluppo delle tue abilit. questo strumento entry-level della gamma lx racchiude un suono eccezionale, supportato dalla tecnologia audio avanzata dell\'ammiraglia lx-9. senti la fluida azione ibrida mentre le tue dita scivolano sui tasti. sintonizzati su comode funzionalit digitali per promuovere le prestazioni e supportare l\'apprendimento. e stai certo che hai fatto un buon investimento con un futuro esente da manutenzione.', 0, 'Roland', 140, 75, 100, , 1);
