(8, 'Musia Instruments violino mvl-34 con astuccio lusso 3/4', 150.00, 'verniciatura satinata\n\nfondo e fasce in acero\n\ntavola in abete\n\ncordiera con 4 tiracantini\n\nmentoniera\n\npronto per suonare\n\ncompleto di archetto e astuccio sagomato rivestito in nylon telato, portaoggetti e pece tracolla.', 0, 'Musia Instruments', 80, 2, 100, , 2);
