(9, 'Musia Instruments vc10 4/4 violoncello da studio completo.', 499.00, 'vc10 4/4 violoncello da studio completo.\nfinitura satinata\ncorpo in polywood, tavola armonica in acero, tastiera in legno di pero, cordiera e piroli in legno jujube. con borsa, colofonia ed arco', 0, 'Musia Instruments', 75, 8, 100, , 2);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(10, 'Sound Sation violoncello pce-44 virtuoso primo', 260.00, 'la serie virtuoso primo ideale per chi si avvicina allo studio del violincello. grazie alle tecnologie impiegate per la costruzione abbiamo ottenuto uno strumento performante dal rapporto qualit prezzo eccezionale. le ottime finiture, cos come la lavorazione denotano una grande cura nei particolari che solitamente si trova in strumenti di fascia molto pi alta, offrendo cos al giovane violinista uno strumento per iniziare a studuare performante, accessibile e facile da suonare. lo strumento viene offerto con cordiera in lega di alluminio completa di accordatori individuali, archetto, borsa morbida, colofonia e tracolle.', 0, 'Sound Sation', 140, 10, 100, , 2);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(11, 'GEWA Contrabbasso Rockabilly 3/4', 1699.00, 'l contrabbasso Rockabilly GEWA è Realizzato in abete e acero laminato, presenta delle spalle a forma di viola da gamba, consentendo un\'ampia praticità al capotasto, nelle posizioni più ardue di questo meraviglioso strumento. La sonorità e la solidità della tastiera in Ebano ed il ponte regolabile fanno di questo contrabbasso lo strumento ideale per lo slap ed il wolking bass.', 0, 'Gewa', 87, 10, 100, , 2),
(12, 'GEWA Contrabbasso 4/4 Premium Line Semi-Massello', 2159.00, 'La serie Premium line di Gewa rappresenta un compromesso perfetto tra qualità costruttiva e prezzo. Realizzato in abete massello e acero laminato, presenta delle spalle a forma di violino, consentendo un\'ampia praticità al capotasto, nelle posizioni più ardue di questo meraviglioso strumento. La sonorità e la solidità della tastiera in Ebano, fanno di questo contrabbasso lo strumento ideale per lo studio fino ai livelli più avanzati.', 0, 'Gewa', 201, 13, 100, , 2);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(13, 'Musia Instruments cl10 clarinetto sib da studio', 169.00, 'clarinetto musia, ottimo per principianti o studenti. il marchio musia collaudato e approvato dai tecnici di citt della musica diventato ormai un punto di riferimento per gli strumenti entry level.\nquesti clarinetti sono garanzia di un ottimo rapporto qualità prezzo.\nresa sonora eccezionale e prezzo contenuto', 0, 'Musia Instruments', 38, 2, 100, , 3);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(14, 'Buffet Crampon E11 In MiB B2301-2-0W', 1860.00, 'E11 Clarinetto MIb BUFFET & CRAMPON FRANCE.\n\nTutto in ebano\n\nChiavi argentate 18/6 \n\nAstuccio a z', 0, 'Buffet Crampon', 39, 2, 97, , 3);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(15, 'YAMAHA YOB-241', 1799.00, '\nOBOE PER STUDENTI IN ABS\n\nSi tratta di un oboe con il corpo in resina ABS più accessibile, con il sistema Conservatoire semplificato, caratteristiche che lo rendono più facile suonare per i principianti. L\'intonazione sorprendentemente precisa consente agli studenti di concentrarsi sullo sviluppo delle proprie capacità musicali. Non c\'è proprio niente però \"da studente\" nel suono ricco e ampio. Il modello 241 ha il tipico suono caldo dell\'oboe molto vicino a quello di uno strumento professionale, che mette in grado anche un principiante assoluto di sviluppare rapidamente un suono ricco e vibrante.', 0, 'Yamaha', 65, 1, 100, , 3),
(16, 'GRASSI SOB1700', 1079.00, 'La serie School di Grassi è progettata specificamente per gli studenti. Tutti gli strumenti Grassi sono fabbricati utilizzando tecniche e standard professionali esigenti che garantiscono una facile suonabilità e qualità.', 0, 'Grassi', 65, 1, 99, , 3);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(17, 'GRASSI SBASS101', 2099.00, 'Il fagotto è uno strumento fondamentale nelle orchestre, sia come basso che come solista. Esistono due tipi di sistemi di chiavi per fagotto, il sistema tedesco ed sistema francese. Il sistema tedesco (Heckel) è ampiamente utilizzato in tutto il mondo. Il sistema francese si basa sul fagotto del periodo barocco che ha meno chiavi, quindi è difficile controllarne l\'intonazione ed ha un volume piccolo, ma è ancora popolare in Francia.', 0, 'Grassi', 140, 2, 100, , 3);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(18, 'JUPITER JTU1020', 3399.00, 'Tuba in MIb / Intonazione: MIb / Astuccio con ruote e accessori / Ottone, laccato / Compatta 4/4 Tuba / Canneggio: 17.60 mm / Campana: diametro 381 mm / Cannello: Ottone ramato, laccato / Pistoni: 3+1, Acciaio inox / Peso: 7.40 kg / Altezza: 83 cm / Astuccio JUPITER : JPKC80BC', 0, 'Jupiter', 84, 8, 100, , 4);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(19, 'YAMAHA YTR-5335 GII', 1469.00, 'Con una serie di miglioramenti rispetto al popolare modello MkI, la tromba YTR-5335GII in offre un suono straordinario e una risposta con prestazioni coerenti - perfetta per i trombettisti che provengono da un modello entry-level.', 0, 'Yamaha', 50, 1, 98, , 4);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(20, 'GRASSI TRB300 MKII', 545.00, 'Trombone in Sib a tre pistoni.', 0, 'Grassi', 12, 4, 100, , 4);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(21, 'GRASSI SAL700', 429.00, 'La linea Grassi School è il risultato di uno studio specifico indirizzato alla realizzazione di strumenti musicali per studenti che approcciano per la prima volta uno strumento a fiato. Utilizzando le esperienze e le tecniche sviluppate nelle produzioni più professionali, in questa gamma si ha la certezza di uno strumento scolastico molto performante e immediato.', 0, 'Grassi', 60, 1, 99, , 4);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(22, 'ROLAND VQD106 Drum Kit', 2299.00, 'Quando si esercitano a casa, i batteristi amano immergersi nell\'esperienza. Ma chi sta intorno al batterista vuole solo che il rumore finisca. Il design silenzioso di V-Drums rende tutti felici, offrendo il rumore di esecuzione in casa più basso nella storia della batteria. Le nostre tecnologie rivoluzionarie rendono possibile l\'impossibile, consentendoti di suonare senza limiti in qualsiasi momento, mentre gli altri che non possono vederti non sapranno mai che stai suonando la batteria. Le Roland V-Drums sono già tra le batterie elettroniche più silenziose disponibili, grazie ad anni di ricerca e sviluppo, ingegneria di precisione e alla possibilità di monitorare con le cuffie. Tuttavia, anche le V-Drums standard a volte possono essere troppo rumorose per essere apprezzate. Il rumore fisico dei pad che colpiscono può essere fastidioso per le altre persone nel tuo spazio abitativo. Inoltre, i pedali della cassa e del charleston trasferiscono colpi e vibrazioni di fascia bassa al pavime', 0, 'Roland', 150, 30, 100, , 5);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(23, 'ROLAND VAD716-PW Drum Kit', 9000.00, 'La Serie V-Drums 7 inaugura un nuovo dinamico capitolo nella storia V-Drums, elevando ulteriormente le batterie elettroniche leader a livello globale, con un modulo sonoro reimmaginato, pad di nuova generazione e migliori funzionalità creative. La nostra ultima piattaforma top gamma offre due modi per suonare: una libreria di suoni integrata, creata in collaborazione con Drum Workshop (DW), e il software DW Soundworks per il drumming basato su computer. E con la connettività wireless integrata e Roland Cloud Connect sul vostro smartphone, potete cambiare istantaneamente il vostro sound grazie ad una libreria in continua crescita di V-Drums Instrument Expansion, Kit Pack e molto altro. VAD716 porta la potenza espressiva della Serie V-Drums 7, nella batteria V-Drums Acoustic Design top di gamma. Il PD-14DSX porta a un livello superiore la nostra tecnologia dei rullanti digitali con una rilevazione ancora più dettagliata, una leva di rilascio del rullante e una manopola per la regolazione', 0, 'Roland', 200, 70, 99, , 5);
INSERT INTO `instruments` (`id`, `name`, `price`, `description`, `feedback`, `brand`, `dimensions`, `weight`, `quantity`, `picture`, `codCategory`) VALUES
(24, 'EKO DRUMS ED-100 Drum Kit Metallic Blue', 100.00, 'Inizia il tuo viaggio musicale con Eko Drums, il modo perfetto e semplice per iniziare a sperimentare i primi ritmi sulla batteria. I fusti in legno multistrato molto resistenti consentiranno ai bambini e ai ragazzi di fare le prime esperienze giocando con la musica e saranno in grado di muovere i primi passi nel mondo della musica ad un prezzo accessibile.Con questi kit Eko Drums punta ad essere il primo strumento all\'interno di un percorso di apprendimento duraturo, o semplicemente lo strumento per passare ore di svago, per studiare a scuola o esibirvi live o in streaming sui social, tutto questo non farà che portare a compimento il nostro comune obbiettivo: fare musica divertendosi.\nIl kit viene fornito di tutto ciò di cui hai bisogno per suonare la batteria: oltre ai fusti la ED-100 è dotata anche di piatto da 8\". Incluso nel set troviamo uno sgabello dalla comoda seduta imbottita, supporto per rullante su grancassa, un\'asta per il piatto ed il supporto per tom su grancassa, il ped', 0, 'Eko Drums', 60, 10, 97, , 5),
(25, 'JUPITER JFL1000RE', 1010.00, 'Il corpo e le chiavi placcati in argento più una testata in argento sterling conferiscono al JFL1000RE un tono pieno e ricco. Presenta un design a foro aperto. Viene fornito con custodia e copertina francesi. L\'argento .925 Sterling Silver Headjoint offre al musicista un tono più scuro e ricco con maggiore calore, proiezione e potenza. C Footjoint è una caratteristica standard per la maggior parte dei flauti per studenti così come per alcuni modelli intermedi e professionali e porta la gamma al DO basso. Il meccanismo Split E migliora notevolmente la risposta del Mi acuto con conseguente migliore intonazione e armonici più precisi.', 0, 'Jupiter', 67, 1, 100, , 4);

